a.onPostDeserialize:
__ht__function(json, dm, gv, datas) {gv.setMovableFunc(function() { return false });
gv.getSelectWidth = function() {return 0};
// 点击事件
gv.mi(function (e) {
	if (e.kind === 'doubleClickBackground') {
        changeScene();
	}
})

/**
 * 切换至外景
 *
 */
function changeScene() {
    dataModel.clear();
    dataModel = new ht.DataModel();
    let g3d = new ht.graph3d.Graph3dView(dataModel);

    g3d.addToDOM();
    g3d.deserialize('scenes/waterSystem/waterWorks.json');
    g3d.setEye([452, 212, 744]);     // 设置眼睛
    g3d.setCenter([111, 8, 199]);    // 设置中心点 
    g3d.setFar(1000000);             // 设置远端位置
    clearInterval(tn);
}

const mapInteractor = new ht.graph3d.MapInteractor(gv)
gv.setInteractors([
    mapInteractor
]);

// 面板数据
dm.getDataByTag('state1').a('title', '운행 상태');
dm.getDataByTag('state1').a('open', '개방');
dm.getDataByTag('state1').a('close', '폐쇄');
dm.getDataByTag('state2').a('title', '운행 상태');
dm.getDataByTag('state2').a('open', '개방');
dm.getDataByTag('state2').a('close', '폐쇄');

dm.getDataByTag('filter1').a('key1', 'PH');
dm.getDataByTag('filter1').a('key2', '탁도');
dm.getDataByTag('filter1').a('key3', '액상');
dm.getDataByTag('filter1').a('key4', '압력');

dm.getDataByTag('filter3').a('title', '');
dm.getDataByTag('filter3').a('key1', 'PH');
dm.getDataByTag('filter3').a('key2', '탁도');
dm.getDataByTag('filter3').a('key3', '액상');
dm.getDataByTag('filter3').a('key4', '압력');

var tn = setInterval(function() {
    var random = Math.random() * (50 - 10 + 1) + 10; 
    var randomPH = Math.random() * (14 - 0 + 1) + 0;
    var randomCl = Math.random() * (0.5 - 0.02 + 1) + 0.02;
    dm.getDataByTag('state1').a('status')?dm.getDataByTag('state1').a('status', false):dm.getDataByTag('state1').a('status', true);
    dm.getDataByTag('state2').a('status')?dm.getDataByTag('state2').a('status', false):dm.getDataByTag('state2').a('status', true);

    dm.getDataByTag('filter1').a('value1', randomPH.toFixed(2) + '');
    dm.getDataByTag('filter1').a('value2', random.toFixed(2) + '  FTU');
    dm.getDataByTag('filter1').a('value3', (random  + 5).toFixed(2) + '  %');
    dm.getDataByTag('filter1').a('value4', (random - 8).toFixed(2) + '  Mpa');

    dm.getDataByTag('filter2').a('content1', 'PH  ：      ' + randomPH.toFixed(2) + '');
    dm.getDataByTag('filter2').a('content2', '탁도 ：     ' + random.toFixed(2) + 'FTU');
    dm.getDataByTag('filter2').a('content3', '액상 ：     ' + (0.8 * random).toFixed(2) + '%');
    dm.getDataByTag('filter2').a('content4', '압력 ：     ' + (0.9 * random).toFixed(2) + 'Mpa');

    dm.getDataByTag('filter3').a('value1',  (randomPH * 0.6).toFixed(2) + '');
    dm.getDataByTag('filter3').a('value2',  random.toFixed(2) + 'FTU');
    dm.getDataByTag('filter3').a('value3',  (0.5 * random).toFixed(2) + '%');
    dm.getDataByTag('filter3').a('value4',  (0.7 * random).toFixed(2) + 'Mpa');

    dm.getDataByTag('panel').a('value1', (random).toFixed(2) + '  %');
    dm.getDataByTag('panel').a('value2', (random * 0.8).toFixed(2) + '  MPa');
    dm.getDataByTag('panel').a('value3', (random * 0.6).toFixed(2) + '  FTU');
    dm.getDataByTag('panel').a('value4', randomCl.toFixed(2) + '  mg/L');
    dm.getDataByTag('panel').a('value5' , randomPH.toFixed(2));
}, 1000);

dm.getDataByTag('panel').a('title', '');
dm.getDataByTag('panel').a('params1', '액상');
dm.getDataByTag('panel').a('params2', '압력');
dm.getDataByTag('panel').a('params3', '탁도');
dm.getDataByTag('panel').a('params4', '잔여염소');
dm.getDataByTag('panel').a('params5', 'PH');
dm.getDataByTag('panel').a('params6', '');
dm.getDataByTag('panel').a('value6', '');}
